import api from "./baseApi";

export const usertagApi = {
  getUserTags(params, cancelToken) {
    return api.get("/api/tag", { params, cancelToken });
  },
  postUserTag(payload) {
    return api.post("/api/tag", payload);
  },
  putUserTag(id, payload) {
    return api.put(`/api/tag/${id}`, payload);
  },
  deleteUserTag(usertagId) {
    return api.delete(`/api/tag/${usertagId}`);
  },
};
